⚡️Минфин РФ, коротко о главном:

— при необходимости будут приняты меры по докапитализации банков;

— в бюджете есть ресурсы для выполнения социальных обязательств в текущих условиях;

—Минфин подготовил предложение о проведении более масштабной амнистии капитала. 

Новости России

⚡️Банк России сделал заявление в связи с санкциями: 

— Банк России будет непрерывно предоставлять банкам наличную и безналичную ликвидность в рублях;

— Российская банковская система стабильна, имеет достаточный запас капитала и ликвидности для бесперебойного функционирования в любой ситуации;

— Все средства клиентов на счетах сохранены и доступны в любой момент времени;

— Банковские сервисы предоставляются в обычном режиме. Банковские карты всех банков на территории России также продолжают работать нормально; 

— Передачу финансовых сообщений внутри страны при любом сценарии развития событий обеспечивает Система передачи финансовых сообщений (СПФС) Банка России.

Новости России

Подробно о санкциях Евросоюза против России:

— в санкционные списки внесли Путина, Лаврова, Медведева, Колокольцева, Иванова, Мишустина, Шойгу и Герасимова;

— ограничен доступ правительства России и Центробанка к рынку капитала союза;

— запрещен экспорт в Россию технологий для нефтяной отрасли;

— запрещен экспорт товаров и технологий, необходимых для авиационной и космической отраслей;

— ограничен экспорта товаров и технологий, необходимых для российского сектора обороны и безопасности;

— запрещено предоставление госфинансирования или финансовой помощи для торговли с Россией и инвестиций в страну.

Под санкции ЕС также попали Альфа-банк, «Открытие», банк «Россия» и Промсвязьбанк, Минобороны РФ, СВР, «Оборонпром» и «Рособоронэкспорт», РЖД, «Камаз», «Севкомфлот», «Севмаш» и 60 ведущих компаний российского ВПК, самолетостроительных и кораблестроительных компаний.

Новости России

Сводка от Минобороны:

🔺выведены из строя 118 военных объектов украинской военной инфраструктуры;

🔺11 военных аэродромов;

🔺13 пунктов управления и узлов связи;

🔺14 комплексов ПВО С-300 и «Оса» и 36 РЛС;

🔺сбиты 5 самолётов, вертолёт, 5 беспилотников;
уничтожены 18 танков и других боевых бронемашин;

🔺уничтожены 7 РСЗО и 5 боевых катеров.

Новости России

Заявление Росавиации по поводу введенных ограничений:

— Россия готова принять зеркальные меры в ответ на запрет полетов;

— Запрет «Аэрофлоту» на полеты в Великобританию – это нарушение соглашения о воздушном сообщении между странами;

— Авиакомпании Великобритании 25 февраля выполнят более 70 транзитных рейсов в воздушном пространстве России;

— Российские власти уже направили уведомление о необходимости соблюдения соглашения о воздушном пространстве.

Новости России

Володин обратился к Верховной раде и гражданам Украины. Главное:

— Уважаемые коллеги, проявите благоразумие, волю. Если вы любите свою Родину, сделайте все, чтобы Украина была мирным государством;

— Депутаты Госдумы поддерживают решение нашего президента Владимира Путина о проведении специальной военной миротворческой операции. Ее цель — защитить людей, проживающих на Украине;

— Мы считали и считаем вас братским народом. Действия нашей страны направлены исключительно на защиту мира. Просим вас не ввязываться и не участвовать ни в каких мобилизациях, предложенных киевскими властями. Они не самостоятельны, все приказы даёт Вашингтон и Брюссель;

— Попросите своих близких, кто служит в Вооруженных силах Украины, сложить оружие. Им не нужно участвовать в защите интересов НАТО и США, выполняя преступные приказы киевского антинародного режима;

— Россия никогда не была врагом Украины. Народные республики Донбасса обратились с просьбой о помощи. Помощи от нашей страны ждут граждане Украины — ваши избиратели. Необходимо принимать решение, как дальше будем жить. Сейчас для вас время выбора.

